import React from "react";
import ReactDOM from "react-dom";
import "./Button.css";

const Button = (props) => {
  return (
    <div
      class="button-container"
      style={{
        display: "inline-block",
        width: props.width,
        height: props.height,
      }}
    >
      <a
        href=""
        class="button"
        // style={{ width: props.width, height: props.height }}
        // style={{ verticalAlign: "middle" }}
      >
        {props.text}
      </a>
    </div>
  );
};

export default Button;
